import 'package:course/config/config.dart';
import 'package:course/core/gameController.dart';
import 'package:course/models/base_data.dart';
import 'package:course/models/enum/enums.dart';
import 'package:course/utils/commonUtil.dart';

class AnswerData extends BaseData {
  AnswerData.fromJson(Map<String, dynamic> json): super.fromJson(json);
  AnswerData({id, QuestionType mode, answer}): super(id: id) {
    this.mode = mode??gameController?.currentBlock?.mode;
    this.answer = answer;
  }
  get mode{
    return CommonUtil.getQuestionType(get('mode'));
  }
  set mode(QuestionType val) {
    set('mode', val);
  }
  set answer(val) {
    set('answer', val);
  }
  get answer{
    
    return get('answer', (Environment.env != Env.dev) ? null : '');
  }
  bool get isVaild{
    return answer != null;
  }
  List get value{
    return get<List>('value');
  }
  List get secondary{
    return get<List>('secondary');
  }
  double get score{
    return CommonUtil.getDouble('score');
  }
}



